import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function SignIn() {
  const [loginType, setLoginType] = useState("email");
  const [username, setUsername] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [password, setPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  const navigate = useNavigate();

  const handleUsernameChange = (e) => {
    loginType === "email"
      ? setUsername(e.target.value)
      : setPhoneNumber(e.target.value);
  };

  const handlePasswordChange = (e) => setPassword(e.target.value);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const payload =
      loginType === "email"
        ? { username, password }
        : { phoneNumber, password };

    try {
      const response = await fetch("http://localhost:7001/api/auth/login", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(payload),
      });

      const data = await response.json();

      if (response.ok) {
        localStorage.setItem("token", data.token || "");
        sessionStorage.clear();
        sessionStorage.setItem("role", data.role);
        navigate("/home", { state: { username } });
      } else {
        setErrorMessage(data.message || "Invalid credentials");
      }
    } catch (error) {
      setErrorMessage("An error occurred. Please try again.");
    }
  };

  return (
    <div
      className="flex min-h-screen bg-cover bg-center bg-no-repeat"
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1466781783364-36c955e42a7f?q=80&w=2942&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fHx8fA%3D%3D')",
      }}
    >
      {/* Overlay for readability */}
      <div className="w-full h-full bg-black/50 flex items-center justify-center">
        {/* Sign-In Form Section */}
        <div className="w-full max-w-sm bg-white shadow-md rounded-lg p-6 sm:p-10">
          <h2 className="text-xl sm:text-2xl font-bold text-gray-900 text-center mb-4">
            Sign in to your account
          </h2>

          {errorMessage && (
            <div className="text-red-500 text-center text-sm sm:text-base mb-4">
              {errorMessage}
            </div>
          )}

          <form onSubmit={handleSubmit} className="space-y-6">
            <div>
              <label
                htmlFor="username"
                className="block text-sm font-medium text-gray-700"
              >
                {loginType === "email" ? "Email" : "Phone Number"}
              </label>
              <input
                id="username"
                name="username"
                type={loginType === "email" ? "email" : "tel"}
                value={loginType === "email" ? username : phoneNumber}
                onChange={handleUsernameChange}
                placeholder={
                  loginType === "email"
                    ? "Enter your email"
                    : "Enter your phone number"
                }
                className="w-full mt-1 px-3 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-green-500"
              />
            </div>

            <div>
              <label
                htmlFor="password"
                className="block text-sm font-medium text-gray-700"
              >
                Password
              </label>
              <input
                id="password"
                name="password"
                type="password"
                value={password}
                onChange={handlePasswordChange}
                className="w-full mt-1 px-3 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-green-500"
              />
              <div className="mt-2 text-right">
                <button
                  type="button"
                  onClick={() => navigate("/forgot-password")}
                  className="text-sm sm:text-base text-green-600 hover:underline"
                >
                  Forgot Password?
                </button>
              </div>
            </div>

            <button
              type="submit"
              className="w-full py-2 bg-green-600 text-white rounded-md shadow hover:bg-green-700 transition"
            >
              Sign in
            </button>
          </form>

          <p className="mt-6 text-sm text-gray-500">
            Not a member?{" "}
            <button
              onClick={() => navigate("/")}
              className="text-green-600 hover:underline"
            >
              Sign Up
            </button>
          </p>

          {/* Toggle Login Type */}
          <button
            onClick={() =>
              setLoginType(loginType === "email" ? "phone" : "email")
            }
            className="mt-4 text-sm sm:text-base text-green-600 hover:underline"
          >
            Login with {loginType === "email" ? "Phone Number" : "Email"}
          </button>
        </div>
      </div>
    </div>
  );
}
